import React from 'react';

class Form extends React.Component {
  
  constructor(props) {
    super(props);
    this.state = {
      // isChecked:this.props.isChecked,
    };
	}
	
	onFormClick = () =>{
		console.log("form clicked");
	}

  render(){
    return (
			<div className="form">
				<div className="ui">
					<label>First Name:</label> 
					<input></input>
				</div>	
				<div className="ui">
					<label>Last Name:</label> 
					<input></input>
				</div>
				<div className="ui">
          <label>Age:</label> 
					<select>
						<option value="group1">0-15</option>
						<option value="group2">16-59</option>
						<option value="group3">60-</option>
					</select>
				</div>
				<div className="ui">
          <label>Free Text:</label> 
					<input></input>
				</div>		
				<button onClick="onFormClick">Continue</button>
		
		</div>	
			);

  }
}

export default Form;
